<html lang="en">

<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Document</title>
    <script>
        /**
 * @param {number} n
 * @return {number[]}
 */
        var printNumbers = function (n) {
            var str = ""
            for (let i = 0; i < n; i++) {
                str = str + 9
            }
            var num = parseInt(str)
            // console.log(num)

            var res=[]
            for(let i=1;i<=num;i++){
                res.push(i)
            }
            return res
        };
        printNumbers(2)
    </script>
</head>
